import React, { useEffect, useState } from "react";
<link rel="stylesheet"
          href="https://fonts.googleapis.com/css2?family=Material+Symbols+Rounded:opsz,wght,FILL,GRAD@20..48,100..700,0..1,-50..200"/>

function Home() {

    const [greeting, setGreeting] = useState<string>("Hello2");

    useEffect(() => {
        const intervalId: NodeJS.Timeout = setInterval(() => {
            setGreeting(updateGreetingLanguage());
            // TODO: Change the interval time
        }, 10000);
        return () => clearInterval(intervalId);
    })

    return (
        <>
            <div id="nextPage">
                <p className="firstPage-Project">Projects</p>
                <span className="material-symbols-rounded material-icons md-36">
                    keyboard_double_arrow_down
                </span>
            </div>

        </>
    );
}

export default Home;
function updateGreetingLanguage(): string {
    //TODO: Provide more language
    let greetingLanguage: string[] = ["Hello", "你好"];
    return greetingLanguage[Math.floor(Math.random() * greetingLanguage.length)];
}
